import React, { Component } from "react";
import { motion } from "framer-motion";
import { Container, Row, Col} from "react-bootstrap";
import github from "../img/github.svg"
import codepen from "../img/codepen.svg"

export default class Contact extends Component {
  render() {
    return (
      <Container className="_container" fluid>
        <motion.div
          initial={{ opacity: 0, x: -100 }}
          animate={{ opacity: 1, x: 0 }}
          exit={{ opacity: 0, x: -100 }}
          transition="linear"
        >
          <h3 className="pageTitle">Portföy</h3>
          <Row>
            <Col className="portfolio-container">
              <img src={github} className="portfolio-svg"></img>
              <p><a href="">Githup profilimi incelemek için tıklayınız.</a></p>
            </Col>
            <Col className="portfolio-container">
              <img src={codepen} className="portfolio-svg"></img>
              <p><a href="">Codepen profilimi incelemek için tıklayınız.</a></p>
            </Col>
          </Row>
        </motion.div>
      </Container>
    );
  }
}
